import React from 'react';
import { Link } from '@reach/router';

const Navigation = () => {
    return (
        <nav className="navigation">
           <Link> <a href="/">Home</a> </Link>
           <Link> <a href="/">Questions</a></Link>
           <Link> <a href="/">Ask a Questions</a> </Link>
        </nav>
    )
};

export default Navigation;
